import React from "react";
import { withStyles } from "@material-ui/core/styles";

const styles = {
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto"
  }
};

function StarFrame(props) {
  const { classes } = props;

  return (
    <div className={classes.all}>
      <iframe
        className={classes.picture}
        title="skymap"
        src={props.finalQuery}
        width="800"
        height="640"
      />
    </div>
  );
}

export default withStyles(styles)(StarFrame);
